import{f as a}from"index-939d0dd8.js"/*tpa=https://cdn.w3cbus.com/mdui/design-1/assets/index-939d0dd8.js*/;const i={a1:"抽屉式导航从左侧滑入，包含了应用的导航目标。",a2:"抽屉式导航和屏幕等高，抽屉后面的内容依然可见，但是被蒙上了一层半透明黑色的遮罩。",a3:`抽屉式导航遵循<a class="do-router" href="${a("/components/lists.html")}">列表</a>的关键线和度量。`,a4:"静止海拔高度",a5:"抽屉式导航类型",a6:"固定显示<br />持续显示<br />迷你版<br />临时显示",a7:"规格",a8:"内容",a9:"行为",a10:"排版",a11:"名称：Roboto Medium，14sp，#FFFFFF",a12:"邮箱地址：Roboto Regular，14sp，#FFFFFF",a13:"列表项：Roboto Medium，14sp，87% #000000",a14:"副标题：Roboto Medium，14sp，54% #000000。与 16dp 的关键线对齐。",a15:"关键线和边距",a16:"图标和屏幕左右两边边距：16dp",a17:"图标颜色值：54% #000000",a18:"带图标或头像的内容的左边距：72dp",a19:"侧边导航宽度：等于屏幕宽度减去操作栏高度。在上面的例子中，抽屉式导航距离屏幕右侧 56dp。",a20:"最大宽度：抽屉式导航最大宽度在手机上为 280dp，在平板上为 320dp。这个数值是由标准增量乘以 5 得出的（标准增量在手机上为 56dp，在平板上为 64dp）。",a21:"手机上的水平间距为 16dp，平板上为 24dp。",a22:"垂直间距",a23:"状态栏：24dp",a24:"副标题：56dp",a25:"内容区域之间的间距：8dp",a26:"副标题和列表项：48dp",a27:"为每个列表组的顶部和底部添加 8dp 的内边距。有一个例外是：列表组的顶部是一个副标题，则可以不加，因为副标题已经包含了边距。",a28:"海拔高度",a29:"抽屉式导航和屏幕等高（包含状态栏），静止海拔高度是 16dp。抽屉后面的内容依然可见，但是会被蒙上一层半透明的黑色遮罩。",a30:"Android 上的抽屉式导航",a31:"选中状态",a32:"被选中的列表项会将其颜色改为应用的主色（或 #000000 100%），来指示出已被选中。此外，触摸涟漪也会高亮出选中项所在的行。",a33:"如果触摸涟漪/高亮和应用的主色之间没有足够的对比度，请使用主色中更暗的色调。",a34:"被选中的列表项",a35:"触摸涟漪/高亮",a36:"分隔线",a37:"抽屉式导航中所有的分隔线都是全出血的，每个分隔线的上方和下方都有 8dp 的内边距。",a38:"分隔符示例",a39:"8dp 的垂直间距",a40:"滚动",a41:"抽屉式导航的滚动方式和视图的滚动方式相同。",a42:"滚动前的抽屉式导航",a43:"滚动中的抽屉式导航",a44:"设置和支持",a45:"在滚动时，设置和支持始终位于列表底部，与其他列表内容对齐。它们指的是 “帮助”、“返回” 或 “帮助 & 反馈”，取决于你的产品提供什么。",a46:"滚动时，设置和支持始终位于列表底部。",a47:"固定显示",a48:"建议的桌面端默认值",a49:"固定显示的抽屉式导航始终可见，并固定在左边缘，和内容或背景在同一海拔高度。它们不能被关闭。",a50:"使用以下最小值来计算固定的阈值：",a51:"1. 侧边导航宽度<br />2. 内容宽度<br />3. 内容边距",a52:"固定显示的抽屉式导航类型",a53:"整个界面的结构和行为决定了要使用何种固定显示的抽屉式导航：",a54:"<strong>全高的抽屉式导航</strong>：应用使用从左到右的层次结构，并专注于内容展示",a55:"<strong>被应用栏截断的抽屉式导航</strong>：应用需要平衡整个屏幕，并专注于生产力",a56:"<strong>浮动抽屉式导航</strong>：应用需要更少的层次结构",a57:"固定显示的、全高的抽屉示例",a58:"固定显示的、被截断的抽屉示例",a59:"固定显示的、浮动抽屉示例",a60:"卡片中的固定显示的、浮动的抽屉示例",a61:"连续显示",a62:"连续显示的抽屉式导航可以在打开和关闭之间切换。抽屉的海拔高度和内容相同。它默认关闭，点击菜单图标后会打开，打开后一直显示，直到被用户关闭。抽屉会在各个操作和各个会话之间保持同一状态。",a63:"当位于页面网格之外的抽屉被打开时，抽屉会强制其他内容改变大小，来适应更小的视图。",a64:"连续显示的抽屉式导航适用于所有比手机尺寸大的设备。",a65:"关闭的连续显示的抽屉示例",a66:"打开的连续显示的抽屉示例",a67:"对于需要使用向上箭头进行导航的有多个层次结构的应用，不建议使用连续显示的抽屉式导航。",a68:"迷你版",a69:"在这种变体中，连续显示的抽屉式导航改变了宽度。它的静止状态是一个小型抽屉，和内容处于同一海拔高度，且被应用栏截断。展开时，它就变成了标准的连续显示的抽屉式导航栏。",a70:"<strong>推荐用于：</strong><br />需要从内容旁边快速访问应用的其余部分",a71:"迷你版抽屉的示例",a72:"打开的连续显示的抽屉示例",a73:"临时显示",a74:"临时显示的抽屉式导航可以切换打开和关闭状态。默认情况下关闭，抽屉式导航会在所有其他内容之上暂时打开，直到选择了某个部分后会自动关闭。",a75:"<strong>推荐用于：</strong><br />平板",a76:"<strong>必须用于：</strong><br />手机",a77:"手机上的关闭的临时抽屉示例",a78:"手机上打开的临时抽屉示例",a79:"也可以把迷你版作为临时抽屉式导航的关闭状态。",a80:"平板上关闭的临时抽屉示例",a81:"平板上打开的临时抽屉示例",a82:"桌面端关闭的临时抽屉示例",a83:"桌面端打开的临时抽屉示例",a84:"Material Design 中的抽屉式导航从左侧滑入",a85:"Material Design 抽屉式导航的版本",a86:"Material Design 抽屉式导航的关键线和边距",a87:"Material Design 抽屉式导航的垂直间距",a88:"Material Design 中的抽屉式导航",a89:"Material Design 抽屉式导航的被选中列表项",a90:"Material Design 抽屉式导航的触摸涟漪/高亮",a91:"Material Design 抽屉式导航的触摸涟漪/高亮",a92:"Material Design 抽屉式导航的触摸涟漪/高亮",a93:"Material Design 抽屉式导航的触摸涟漪/高亮",a94:"Material Design 抽屉式导航的触摸涟漪/高亮",a95:"Material Design 抽屉式导航的分隔符示例",a96:"Material Design 抽屉式导航的 8dp 的垂直间距",a97:"Material Design 中的滚动前的抽屉式导航",a98:"Material Design 中的滚动中的抽屉式导航",a99:"Material Design 抽屉式导航滚动时，设置和支持始终位于列表底部",a100:"Material Design 中的固定抽屉式导航始终可见",a101:"Material Design 中的全高固定抽屉示例",a102:"Material Design 中的固定、截断抽屉示例",a103:"Material Design 的固定显示浮动抽屉示例",a104:"Material Design 卡片中的固定显示浮动抽屉示例",a105:"Material Design 中的关闭的抽屉示例",a106:"Material Design 中的打开的抽屉示例",a107:"Material Design 不建议使用连续显示的抽屉式导航",a108:"Material Design 中的迷你版抽屉示例",a109:"Material Design 中的连续显示抽屉示例",a110:"手机上关闭的 Material Design 临时抽屉示例",a111:"手机上打开的 Material Design 临时抽屉示例",a112:"平板上关闭的 Material Design 临时抽屉示例",a113:"平板上打开的 Material Design 临时抽屉示例",a114:"桌面端关闭的 Material Design 临时抽屉示例",a115:"桌面端打开的 Material Design 临时抽屉示例"};export{i as zhCn};
